import React from "react";
import about from "../../assests/aboutus.jpg";

const About = () => {
  return (
    <div className="h-full w-full">
      <div className="h-[115px] w-full bg-[#F0F0F0]">
        <h1 className="text-[50px] py-[20px] text-[] tracking-widest font-bold leading-[60px]">
          About Us
        </h1>
      </div>
      <img src={about} alt="About Us" />
    </div>
  );
};

export default About;
